import React from "react";
import Definition from "./Definition";
import DarkLightToggle from "./DarkLightToggle";

function App() {
    return (
        <div className="static flex flex-row-reverse">
            <div className="bg-[#eaeaea] w-[70%] flex flex-row-reverse dark:bg-[#212121] h-[1000px] mt-10">
                <DarkLightToggle></DarkLightToggle>
            </div>
            <div className="right bg-[#ff4f93] w-[30%]">
                <div className="bg-sigLight dark:bg-sigDark w-16 m-10 h-[1000px] bg-no-repeat ml-10"></div>
            </div>
            <Definition></Definition>
        </div>
    );
}

export default App;
